import { Typography } from '@material-ui/core';
import 'bootstrap/dist/css/bootstrap.min.css';
import about from './img/about.jpg'
import {makeStyles} from "@material-ui/core/styles";
import home1 from './img/home1.png'
import about111 from './img/about111.jpeg'

const useStyles = makeStyles((theme) => ({
    centerText : {
        position: 'absolute',
        top: '70%' ,
        left: '25%' ,
        fontSize : '30px',
        fontWeight : 'bold',
        transform: "translate('-50%' , -'50%' )" ,
        width: '30%',
        height: 'auto',
    },
    h:{
        marginTop : '20%',
        color: "green"
    },

    text : {
           fontSize : '15px',
           color: "green",
           fontStyle: "sans-serif",
    },

    frame : {
        height: "auto",
        overflow: "visible",
        display: 'block',
        width: '100%',
      }

}));

export default function About() {

    const myClass = useStyles();

    return(

        <div className="container">
            <div className="row">
                <div className="col-xs-12">
                    <img src={about} width = '100%' height = 'auto' style = {{marginTop: '10%'}}/>
                    <Typography className={myClass.centerText}>Inspired by Global Experiences, Fueled by Hard Work And Passion</Typography>
                </div>
            </div>
            <div className="row">
            <div className="col-xs-12">
                    <h4 className={myClass.h}>Who We Are</h4>
                    <Typography className={myClass.text}>We are Students in UOL. We have made this project as FYP</Typography>
                </div>
            </div>

            <div className="row">
            <div className="col-xs-12">
                    <div className={myClass.frame}>

                        <img src={about111}/>
                    </div>
                </div>
            </div>


        </div>
    )
}
